import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './NavBar.css';  // Import the CSS file

const NavBar = () => {
  const navigate = useNavigate();

  const handleIndexClick = () => {
    // Implement the function for the "Index" button
    navigate('/');
  };

  const handleDownloadClick = () => {
    // Implement the function for the "Download" button
    alert('Download feature is not yet implemented.');
  };

  const handleContactUsClick = () => {
    // Implement the function for the "Contact Us" button
    alert('Contact us at support@example.com.');
  };

  const handleHelpCenterClick = () => {
    // Implement the function for the "Help Center" button
    alert('Redirecting to the Help Center...');
    navigate('/help-center');
  };

  const handleSearchClick = () => {
    // Implement the function for the "Search" button
    alert('Search feature is not yet implemented.');
  };

  const handleLoginClick = () => {
    // Implement the function for the "Login" button
    navigate('/login');
  };

  const handleRegisterClick = () => {
    // Implement the function for the "Login" button
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <ul>
        <li><button className="nav-button" onClick={handleIndexClick}>Index</button></li>
        <li><button className="nav-button" onClick={handleDownloadClick}>Download</button></li>
        <li><button className="nav-button" onClick={handleContactUsClick}>Contact Us</button></li>
        <li><button className="nav-button" onClick={handleHelpCenterClick}>Help Center</button></li>
        <li><button className="nav-button" onClick={handleSearchClick}>Search</button></li>
        <li><button className="nav-button" onClick={handleLoginClick}>Login</button></li>
        <li><button className="nav-button" onClick={handleRegisterClick}>Register</button></li>
      </ul>
    </nav>
  );
};

export default NavBar;
